含oh:
@mjt4789 well, i have a channel, so i experienced that copyright strike before. sometimes other youtubers also talk about that. the rest is just common sense. this channel is still up and running and even got verified, isn't it? i saw several copycats channel disappeared, but not this one.

oh, and i got this from google support. "as the copyright owner, they have the exclusive right to use the work. most of the time, only the copyright owner can say whether someone else has permissions to use the work."

or did you mean how do i know that this channel is authorized by her? well, they said so and the verified logo makes it more believable. and apparently zi qi confirmed that too on weibo.

含oh中文翻译:
@mjt4789好吧，我有一个频道，所以我以前经历了这种版权罢工。有时，其他YouTuber也会谈论这一点。其余只是常识。这个频道仍在运行，甚至得到了验证，不是吗？我看到几个模仿者频道消失了，但没有消失。

哦，我从Google的支持中得到了这个。 “作为版权所有者，他们拥有使用这项工作的独家权利。大多数时候，只有版权所有者才能说出其他人是否有权使用这项工作。”

还是您的意思是我怎么知道这个渠道已由她授权？好吧，他们这样说，经过验证的徽标使它更加可信。显然，Zi Qi在微博上也证实了这一点。
